import { Card, Container, Grid } from "@mui/material";
import { useState } from "react";
import AddTask from "./components/AddTask";
import CustomCard from "./components/CustomCard";
import Header from "./components/Header";

function App() {
  const noteData = [
    {
      id: 0,
      title: " Note 1",
      note: "Heloo this ish djdskjajs",
    },
    {
      id: 1,
      title: " Note 2",
      note: "Heloo this ish djdskjajs",
    },
    {
      id: 2,
      title: " Note 3",
      note: "Heloo this ish djdskjajs",
    },
  ];

  const [noteDatas, setNoteDatas] = useState([]);

  return (

    <div className="App">
      <Header />
      {
        noteDatas.length==0 ?(<h1>Add notes </h1>) : ( <Container>
          <Grid container>
            {noteDatas.map((item) => {
              return (
                <Grid item md={4} sm={6} xs={12}>
                  <CustomCard {...item}  setNoteDatas={setNoteDatas} noteDatas={noteDatas}/>
                </Grid>
              );
            })}
          </Grid>

          <AddTask noteDatas={noteDatas} setNoteDatas={setNoteDatas} />
        </Container>)
      }

    </div>
  );
}

export default App;
